/**
 * KR-CLIDN Brand Constants v5.0
 * Shared branding for all templates — logo, colors, CSS
 * Colors extracted from skull logo: Blue #2563EB, Teal #4DD9C0
 */

// Logo 80x80 base64 PNG
export const LOGO_BASE64 = 'data:image/png;base64,';

// Brand Colors (extracted from skull logo)
export const COLORS = {
    primary: '#2563EB',       // Main blue (outline)
    primaryLight: '#3B82F6',  // Light blue
    primaryDark: '#1E3A8A',   // Dark blue
    accent: '#4DD9C0',        // Teal/cyan (jaw)
    accentDark: '#2DD4A8',    // Darker teal
    grayBlue: '#ffffff',      // Gray-blue (accent lines)
    bg: '#000000',            // Pure black background
    surface: '#0a0a12',       // Slightly lighter surface
    text: '#FFFFFF',          // White text
    textMuted: '#ffffff',     // Muted text
    textDim: 'rgba(255,255,255,0.3)', // Dim text
    success: '#00FF88',       // Green for success/terminal
    warning: '#FF9500',       // Orange warning
    error: '#FF3366',         // Red error
    purple: '#A855F7',        // Purple accent
};

// Common CSS that goes in every template
export function brandCSS() {
    return `
        @import url('https://fonts.googleapis.com/icon?family=Material+Icons');
        @import url('https://fonts.googleapis.com/css2?family=JetBrains+Mono:wght@400;500;700;800&family=Inter:wght@400;500;600;700&display=swap');

        * { margin: 0; padding: 0; box-sizing: border-box; }

        body {
            font-family: 'Inter', sans-serif;
            background: ${COLORS.bg};
            color: ${COLORS.text};
            width: 1080px;
            height: 1920px;
            overflow: hidden;
            position: relative;
        }

        .slide {
            position: relative; z-index: 1;
            width: 100%; height: 100%;
            padding: 60px;
            display: flex; flex-direction: column;
        }

        /* ═══ BRAND BAR ═══ */
        .brand-bar {
            display: flex; align-items: center; gap: 16px; margin-bottom: 40px;
        }

        .brand-logo {
            width: 44px; height: 44px;
            object-fit: contain;
            filter: drop-shadow(0 0 6px rgba(37, 99, 235, 0.4));
        }

        .brand-name {
            font-family: 'JetBrains Mono', monospace;
            font-size: 32px; font-weight: 700;
            letter-spacing: 4px; color: ${COLORS.primary};
        }

        .brand-line {
            flex: 1; height: 1px;
            background: linear-gradient(90deg, rgba(37,99,235,0.3), transparent);
        }

        /* ═══ FOOTER ═══ */
        .slide-footer {
            display: flex; justify-content: space-between;
            align-items: center; padding-top: 20px;
        }

        .slide-num {
            font-family: 'JetBrains Mono', monospace;
            font-size: 32px; color: ${COLORS.textDim};
        }

        .footer-accent {
            width: 60px; height: 3px;
            background: linear-gradient(90deg, ${COLORS.primary}, transparent);
        }

        .corner-deco {
            position: absolute; bottom: 60px; left: 60px;
            width: 80px; height: 80px;
            border-left: 2px solid rgba(37,99,235,0.12);
            border-bottom: 2px solid rgba(37,99,235,0.12);
        }

        .content {
            flex: 1; display: flex; flex-direction: column; justify-content: center;
        }
    `;
}

// Brand bar HTML (logo + name + line)
export function brandBarHTML() {
    return `
        <div class="brand-bar">
            <img class="brand-logo" src="${LOGO_BASE64}" alt="KR-CLIDN">
            <div class="brand-name">KR-CLIDN</div>
            <div class="brand-line"></div>
        </div>
    `;
}

// Footer HTML
export function footerHTML(slideNumber) {
    return `
        <div class="slide-footer">
            <div class="footer-accent"></div>
            <div class="slide-num">${slideNumber}</div>
        </div>
        <div class="corner-deco"></div>
    `;
}

// Kali Linux Dragon Watermark (blue dragon)
export const KALI_DRAGON_BASE64 = 'data:image/png;base64,';
